import{_ as e,o as t,c as a,a as i}from"./app.67203037.js";var r="/aktivitaeten/BDM-2024-07/00_07-2024.jpg",s="/aktivitaeten/BDM-2024-07/01_07-2024.jpg",n="/aktivitaeten/BDM-2024-07/02_07-2024.jpg",d="/aktivitaeten/BDM-2024-07/03_07-2024.jpg",o="/aktivitaeten/BDM-2024-07/04_07-2024.jpg",l="/aktivitaeten/BDM-2024-07/05_07-2024.jpg",_="/aktivitaeten/BDM-2024-07/06_07-2024.jpg",p="/aktivitaeten/BDM-2024-07/07_07-2024.jpg",m="/aktivitaeten/BDM-2024-07/08_07-2024.jpg",g="/aktivitaeten/BDM-2024-07/09_07-2024.jpg",v="/aktivitaeten/BDM-2024-07/10_07-2024.jpg",c="/aktivitaeten/BDM-2024-07/11_07-2024.jpg",B="/aktivitaeten/BDM-2024-07/12_07-2024.jpg",M="/aktivitaeten/BDM-2024-07/13_07-2024.jpg",u="/aktivitaeten/BDM-2024-07/14_07-2024.jpg",k="/aktivitaeten/BDM-2024-07/15_07-2024.jpg",h="/aktivitaeten/BDM-2024-07/16_07-2024.jpg",D="/aktivitaeten/BDM-2024-07/17_07-2024.jpg",j="/aktivitaeten/BDM-2024-07/18_07-2024.jpg",f="/aktivitaeten/BDM-2024-07/19_07-2024.jpg",b="/aktivitaeten/BDM-2024-07/20_07-2024.jpg",w="/aktivitaeten/BDM-2024-07/21_07-2024.jpg",A="/aktivitaeten/BDM-2024-07/22_07-2024.jpg",S="/aktivitaeten/BDM-2024-07/23_07-2024.jpg",E="/aktivitaeten/BDM-2024-07/24_07-2024.jpg",z="/aktivitaeten/BDM-2024-07/25_07-2024.jpg",F="/aktivitaeten/BDM-2024-07/26_07-2024.jpg",W="/aktivitaeten/BDM-2024-07/27_07-2024.jpg",N="/aktivitaeten/BDM-2024-07/28_07-2024.jpg",P="/aktivitaeten/BDM-2024-07/29_07-2024.jpg",L="/aktivitaeten/BDM-2024-07/30_07-2024.jpg",T="/aktivitaeten/BDM-2024-07/31_07-2024.jpg",H="/aktivitaeten/BDM-2024-07/32_07-2024.jpg",G="/aktivitaeten/BDM-2024-07/33_07-2024.jpg",q="/aktivitaeten/BDM-2024-07/34_07-2024.jpg",C="/aktivitaeten/BDM-2024-07/35_07-2024.jpg",J="/aktivitaeten/BDM-2024-07/36_07-2024.jpg",Q="/aktivitaeten/BDM-2024-07/37_07-2024.jpg",x="/aktivitaeten/BDM-2024-07/38_07-2024.jpg";const O={},I=i('<h1 id="bilder-des-monats-juli-2024" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-juli-2024" aria-hidden="true">#</a> Bilder des Monats Juli 2024</h1><p>Heute stand die erste GMA (DA/AL-095) Aktivierung f\xFCr DL2MBN an. Das Wetter war super und der Akku geladen.Leider meinte es das 20 m band nicht so gut heute und hat mir in ca 2 Stunden nur 10 qsos beschert. Nichts desto trotz hat es sehr viel Spa\xDF gemacht auch wenn der Weidezaun arg gest\xF6rt hat. 73 DL2MBN</p><p><img src="'+r+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"><img src="'+n+'" alt="Bilder des Monats"><img src="'+d+'" alt="Bilder des Monats"><img src="'+o+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"><img src="'+_+'" alt="Bilder des Monats"><img src="'+p+'" alt="Bilder des Monats"></p><p>DF6TG: Heute meine 1.POTA Aktivit\xE4t, DE-0002 Nagelfluhkette, 600 HM Aufstieg zu Fu\xDF.</p><p><img src="'+m+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+B+'" alt="Bilder des Monats"><img src="'+M+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"></p><p>DL2MBN hatte mal wieder Zeit f\xFCr den heimischen Park ( DE-0566 ) die propagations waren gut das Wetter sagte Sonne voraus, also gleich in der Fr\xFCh los wo es noch k\xFChl am Waldrand ist. In ca 2 Stunden kamen so 86 qsos zustande , das Highlight waren Nord Amerika, Jamaica und Australien.Nach einer Stunde CQ rufen wurde es solangsam hei\xDF und ich wollte QRT gehen. Und dann kam der PILE UP , Sonnencreme raus und durch. Das war eine tolle Erfahrung und ich bedanke mich bei allen Huntern. Das Equipment war ein FT-891 bei 80 Watt an der DF Vertical Antenne. 73 44 DL2MBN</p><p><img src="'+j+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"><img src="'+w+'" alt="Bilder des Monats"><img src="'+A+'" alt="Bilder des Monats"></p><p>DC1TC hat sich in DE-0315 Wasserpark Dove Elbe zum \u201CSupport Your Parks\u201D-Wochenende mal etwas l\xE4nger Zeit genommen und ist auf 75 Kontakte auf 5 B\xE4ndern gekommen mit einigen P2P und n-fer. Mit dabei waren auch mehrere DF2DF- und YOTA-QSOs.</p><p><img src="'+S+'" alt="Bilder des Monats"></p><p>Zum &quot;Support your parks&quot; Wochenende hat DF9HC zwei neue Parks aktiviert. DE-0796 ist ein beliebtes Ausflugsziel vor den Toren Rostocks. Fr\xFCher gab es hier sogar mal einen Skilift. Ganz anders DE-0794. Hier herrscht wilde Natur vor: nur teilweise zug\xE4nglich, Wiesen, Gestr\xFCpp, Moor und Schilf bedecken gro\xDFer Teile des Gebietes. Am ehesten l\xE4sst sich hier noch vom Boot aus aktivieren.</p><p><img src="'+E+'" alt="Bilder des Monats"><img src="'+z+'" alt="Bilder des Monats"><img src="'+F+'" alt="Bilder des Monats"><img src="'+W+'" alt="Bilder des Monats"></p><p>Das Julievent support your park konnte DB6NL im Urlaub nutzen. An beiden Tagen konnte der Park DE-0096 aktiviert werden. Mit 5W kamen jeweils 10 und 17 QSOs inkl einiger P2Ps ins Log. Trotz der unruhigen B\xE4nder an dem Wochenende ein guter Erfolg. Setup: IC-705 mit einer EFHW (20,3m Draht) f\xFCr 40,20,15,10m.</p><p><img src="'+N+'" alt="Bilder des Monats"><img src="'+P+'" alt="Bilder des Monats"><img src="'+L+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"></p><p>Hi zusammen, anbei paar Bilder aus Frankreich w\xE4hrend der Aktivierung von F-3765 Baie de Quiberon an der Atlantikk\xFCste. Aufgrund des Wetters musste ich zwischendurch den Standort um ein paar Meter verlegen. Sp\xE4ter kam aber noch die Sonne raus. Eine sch\xF6ne Ecke, nicht nur zum Funken. Gr\xFC\xDFe DL7BG</p><p><img src="'+H+'" alt="Bilder des Monats"><img src="'+G+'" alt="Bilder des Monats"><img src="'+q+'" alt="Bilder des Monats"><img src="'+C+'" alt="Bilder des Monats"><img src="'+J+'" alt="Bilder des Monats"><img src="'+Q+'" alt="Bilder des Monats"><img src="'+x+'" alt="Bilder des Monats"></p>',15),U=[I];function Z(y,R){return t(),a("div",null,U)}var Y=e(O,[["render",Z],["__file","2024-07-30-Bilder-Des-Monats-Juli.html.vue"]]);export{Y as default};
